              action: () => navigate('/'),
              primary: true
            }
          ]
        };
    }
  };

  const content = getErrorContent();

  return (
    <div className="payment-error-page" style={{ background: content.gradient }}>
      <div className="error-container">
        <div className="error-icon">{content.icon}</div>

        <h1 className="error-title">{content.title}</h1>

        <div className="error-description">
          {content.description}
        </div>

        {content.showTime && (
          <div className="info-box">
            <strong>–¢–µ–∫—É—â–µ–µ –≤—Ä–µ–º—è (–ú–°–ö):</strong>
            <p className="current-time">
              {currentTime.toLocaleTimeString('ru-RU', {
                hour: '2-digit',
                minute: '2-digit',
                second: '2-digit',
                timeZone: 'Europe/Moscow'
              })}
            </p>
          </div>
        )}

        <div className="error-buttons">
          {content.buttons.map((button, idx) => (
            <button
              key={idx}
              className={`error-button ${button.primary ? 'primary' : 'secondary'}`}
              onClick={button.action}
            >
              {button.text}
            </button>
          ))}
        </div>
      </div>
    </div>
  );
};

export default PaymentError;
